import React from 'react'

import { Button, ButtonGroup } from 'react-bootstrap'

const Filters = () => {
    return (
        <ButtonGroup className="mb-2">
            <Button variant="secondary">Botao</Button>
            <Button variant="outline-light">Botao</Button>
            <Button variant="outline-light">Botao</Button>
            <Button variant="outline-light">Botao</Button>
        </ButtonGroup>
    )
}

export default Filters
